import axios from "axios";
import { useEffect } from "react";

export default function SendData({ userLocation, setWeatherData, setIsError }) {
  useEffect(() => {
    async function Send() {
      if (!userLocation) {
        setIsError("Something went wrong with fetching your location");

        try {
          const { location } = userLocation;
          const response = await axios.post("/city", { location: location });
          const result = await response.data;
          console.log("server response:", result.content);

          setWeatherData(result);
        } catch (error) {}
      }

      try {
        const { latitude, longitude } = userLocation;

        const response = await axios.post("/weather", {
          latitude: latitude,
          longitude: longitude,
        });
        const result = await response.data;
        console.log("server response:", result.content);

        setWeatherData(result);
      } catch (error) {
        console.log("Error sending Data:", error);
        setIsError(error.message);
      }
    }
    Send();
  }, [userLocation, setWeatherData, setIsError]);
  return null;
}
